import styles from "./layout.module.css";
import Link from "next/link";

const SocialMedia = () => (
  <div>
    <Link href="/">
      <img src={require("../images/linkedin.png")} />
      <img src={require("../images/Github.png")} />
      <img src={require("../images/twitter.png")} />
    </Link>
  </div>
);

export default SocialMedia;
